import EffectHook from './components/4_EffectHook/EffectHook'
import RefHook from './components/5_RefHook/RefHook'

class App extends React.Component {

  render() {

    return (
      <div>
        <SetState/>
        <hr></hr>
        <LazyLoad/>
        <hr></hr>
        <StateHook/>
        <hr></hr>
        <EffectHook/>
        <hr></hr>
        <RefHook/>
      </div>
    );
  }
}

export default App;
